import React from 'react';
import ReactDOM from 'react-dom';
import Home from './Home';
import './index.css';
import Data from './Data'


function dyn(val){
   return (
      <Home
            title={val.title}
            subtitle={val.subtitle}
            imgsrc={val.imgsrc}
           />
   )
}
ReactDOM.render(

   <>

           {Data.map(dyn())}
   </>,
  document.getElementById('root')
);
